We label the points where the circle is tangent to $\overline{AC}$ and $\overline{BC}$ as $D$ and $E$, respectively. Let $r$ be the radius of the circle. Then, since $OD$ is a radius, we have $OD = DE = r$, so by the Pythagorean theorem ($\bigtriangleup ODE$ is a right triangle), \[
\sqrt{2} r = EC.
\] Squaring both sides, we get \[
2r^2 = EC^2 = 2AC^2 = 8r^2,
\] so $AC = BC = 2r$. Thus the area of triangle $ABC$ is \[
\frac{1}{2}(AC)(BC) = \boxed{2r^2}.
\]

