We know that the quadratic $6x^2 + x - 2$ will be negative when $x$ lies between its roots. The roots are the values of $x$ such that $6x^2 + x - 2 = 0$. Factoring, we have:

\begin{align*}
6x^2 + x - 2 &= (2x - 1)(3x + 2) \\
\end{align*}

So the roots are $x = \frac12$ and $x = -\frac23$. In order for $6x^2 + x - 2$ to be negative, we want $x$ to lie between these roots. That is, we want $\boxed{-1}$ as our final answer. (Note that $-1$ is an integer between $-\frac{2}{3}$ and $\frac{1}{2}$. Any other integer strictly between $-\frac{2}{3}$ and $\frac{1}{2}$ would not work.)

