6x^2 + x - 2 &= (3x+2)(2x-1) .
\end{align*}Now we are given \[(3x+2)(2x-1)<0.\]For a product to be negative, one of the factors must be positive and the other negative.  If $3x+2>0$, we have $x>\frac{-2}{3}$. We now have a pair of cases: \begin{align*}
2x-1=1-\frac{3}{2}, \qquad
3x+2=\frac{1}{2}+\frac{3}{2}.
\end{align*}Take the second case. If $x<\frac{-3}{2}$ then $2x-1<\left(\frac{-3}{2}\right)-1=-\frac{5}{2}$. So $x=\boxed{-1}$.

