\[\int_0^{\pi/2} \frac{1}{2} (1 + \cos \theta)^2 \, d\theta.\]We can do this integral with the substitution $u = \sin \theta,$ $du = \cos \theta \, d\theta,$ to get
\begin{align*}
\int_0^{\pi/2} \frac{1}{2} (1 + \cos \theta)^2 \, d\theta &= \int_0^1 \frac{1}{2} [1 + (1 - u^2)]^2 \cdot \frac{du}{\sqrt{1 - u^2}} \\
&= \int_0^1 \frac{1 + 2u^2 + u^4}{2\sqrt{1 - u^2}} \, du \\
&= \int_0^1 \frac{1}{2} \sqrt{1 - u^2} \, du + \int_0^1 u^2 \sqrt{1 - u^2} \, du \\
&\quad + \int_0^1 \frac{1}{2} u^4 \sqrt{1 - u^2} \, du.
\end{align*}Now,
\begin{align*}
\int_0^1 \frac{1}{2} \sqrt{1 - u^2} \, du &= \frac{1}{2} \cdot \frac{\pi}{4} = \frac{\pi}{8}, \\
\int_0^1 u^2 \sqrt{1 - u^2} \, du &= -\frac{1}{3} \int_0^1 \sqrt{1 - u^2} \, d(1 - u^2) \\
&= -\frac{1}{3} \left[ (1 - u^2) \sqrt{1 - u^2} - \int_0^1 \frac{u^2}{\sqrt{1 - u^2}} \, du \right] \\
&= -\frac{1}{3} (1 - \sqrt{2}) + \frac{1}{3} \arcsin u \bigg\vert_0^1 \\
&= -\frac{1}{3} (1 - \sqrt{2}) + \frac{\pi}{6} - \frac{1}{3} \pi, \\
