&= -\frac{1}{5} \left[ (1 - u^2)^2 - \int_0^1 2u(1 - u^2) \, du \right] \\
&= \frac{4}{15}.
\end{align*}Therefore, the area of the region generated when the curve sweeps out the angle from $\theta = 0$ to $\theta = \frac{\pi}{2}$ (inclusive) is
\[\frac{\pi}{8} - \frac{1}{3} (1 - \sqrt{2}) + \frac{\pi}{6} - \frac{1}{3} \pi + \frac{4}{15} = \frac{1}{60} (5 \pi - 9 \sqrt{2} - 17).\]By symmetry, the area of the region generated when the curve sweeps out the angle from $\theta = \pi$ to $\theta = \frac{3 \pi}{2}$ (inclusive) is exactly the same.  Therefore, the total area is $\boxed{\frac{1}{30} (5 \pi - 9 \sqrt{2} - 17)}.$

