We can write the sum as
\begin{align*}
\sum_{1 \le j < i} \frac{1}{2^{i + j}} &= \sum_{i = 2}^\infty \sum_{j = 1}^{i - 1} \frac{1}{2^{i + j}} \\
&= \sum_{i = 2}^\infty \sum_{j = 1}^{i - 1} \frac{1}{2^i \cdot 2^j}.
\end{align*}By geometric series,
\[\sum_{j = 1}^{i - 1} \frac{1}{2^j} = \frac{1/2 - 2^{1 - i}}{1 - 1/2} = 2^{2 - i}.\]Then the sum becomes
\begin{align*}
\sum_{i = 2}^\infty 2^{2 - i} \cdot \frac{1}{2^i} &= \sum_{i = 2}^\infty \frac{1}{2^i} \\
&= \frac{1/2^2}{1 - 1/2} = \boxed{\frac{1}{2}}.
\end{align*}

