gpt-4:
First, we simplify the expression to \begin{align*}
14u &\equiv 46 \pmod{100} \\
-u &\equiv -4\pmod{100}
\end{align*} by expanding by $3$. Then, we replace $u$ with $100v - 4$ for some nonnegative integer $v$. We have \begin{align*}
&-u \equiv -4\pmod{100} \\
\Rightarrow\qquad &-(100v - 4) \equiv -4 \pmod{100} \\
\Rightarrow\qquad &100v \equiv 0 \pmod{100}.
\end{align*}Thus, any $u$ which is $4$ less than a multiple of $100$ is a solution.

The smallest positive such solution is $4$. The next smallest is $100 + 4 = 104$. Their average is $\boxed{54}$.

