For $0 \le t \le 4,$ note that
\[x = 3t^2 - 9t - 5 = 3(t - 5)(t + 1)\]and
\[y = t^2 - 3t + 2 = (t - 1)(t - 2).\]Furthermore, these ranges are achievable.  To prove this, let $t = \frac{k}{4}.$  Then
\[(x + 5)(x - 3) = k^2\]and
\[(y - 1)(y - 2) = k^2.\]We see that the quadratics $(x + 5)(x - 3)$ and $(y - 1)(y - 2)$ have no roots in common.  But if there are no common roots, then there must always be some value of $t$ where $(x + 5)(x - 3)$ and $(y - 1)(y - 2)$ are equal.  (Proving this would come from considering the quadratic $(x + 5)(x - 3) - (y - 1)(y - 2),$ which may also be of some interest to you.)

Hence, the curve is given by
\[(x + 5)(x - 3) = (y - 1)(y - 2),\]which factors as
\[(x - y + 6)(x + y - 1) = 7.\]In particular, the tennis ball traces some ellipse.

[asy]
unitsize(0.4 cm);

pair moo (real t) {
  real x = 3*t^2 - 9*t - 5;
  real y = t^2 - 3*t + 2;
  return((x,y));
}

path foo = moo(0);
real t;

for (t = 0; t<= 4 + 0.01; t = t + 0.01) {
  foo = foo--moo(t);
}

draw(foo,red);

draw((-8,0)--(2,0));
draw((0,-1)--(0,7));

label("$x$", (2,0), E);
label("$y$", (0,7), N);
[/asy]

Let $s = 2t - 4,$ so $2 \le s \le 12$ and $t = \frac{s + 4}{2}.$  Then
\[x = 3 \left( \frac{s + 4}{2} \right)^2 - 9 \cdot \frac{s + 4}{2} - 5 = -\frac{1}{2} s^2 + 2s - 7\]and
\[y = \left( \frac{s + 4}{2} \right)^2 - 3 \cdot \frac{s + 4}{2} + 2 = \frac{1}{2} s^2 - 5s + 12,\]so
\begin{align*}
\frac{dx}{ds} &= -s + 2, \\
\frac{dy}{ds} &= s - 5.
\end{align*}Thus,
\[\sqrt{\left( \frac{dx}{ds} \right)^2 + \left( \frac{dy}{ds} \right)^2} = \sqrt{2s^2 - 14s + 29}.\]We compute
\[\sqrt{\left( \frac{dx}{ds} \right)^2 + \left( \frac{dy}{ds} \right)^2} = 3 \sqrt{2} \cdot \frac{8 - 7 \cos \theta}{\sqrt{2} \cdot 3},\]so
\[\int_2^{12} \sqrt{\left( \frac{dx}{dt} \right)^2 + \left( \frac{dy}{dt} \right)^2} \, ds = \boxed{14}.\]

solution:
If we take $x = 3t^2 - 9t - 5$ and $y = t^2 - 3t + 2,$ then
\[y = t^2 - 3t + 2 = \frac{3t^2 - 9t + 6}{3} = \frac{x + 11}{3}.\]Thus, the path of the tennis ball traces a line segment.

Furthermore,
\[x = 3t^2 - 9t - 5 = 3 \left( t - \frac{3}{2} \right)^2 - \frac{47}{4}.\]Thus, as $t$ varies from 0 to 4, $x$ varies from $-5$ (at $t = 0$), to $-\frac{47}{4}$ (at $t = \frac{3}{2}$), to 7 (at $t = 4$).  The plot below shows the position of the tennis ball as a function of time $t,$ with the time indicated.

[asy]
unitsize(0.4 cm);

real t;

pair parm (real t) {
  return((3*t^2 - 9*t - 5,t^2 - 3*t + 2));
}

path trail = parm(0);

for (t = 0; t <= 4; t = t + 0.1) {
  trail = trail--parm(t);
}

trail = trail--parm(4);

draw(trail,red);

dot("$0$", parm(0), NW);
dot("$1$", parm(1), NW);
dot("$\frac{3}{2}$", parm(1.5), W);
dot("$2$", parm(2), SE);
dot("$3$", parm(3), SE);
dot("$4$", parm(4), SE);
[/asy]

Thus, the tennis ball traces the line segment with endpoints $\left( -\frac{47}{4}, -\frac{1}{4} \right)$ and $(7,6),$ and its length is
\[\sqrt{\left( 7 + \frac{47}{4} \right)^2 + \left( 6 + \frac{1}{4} \right)^2} = \boxed{\frac{25 \sqrt{10}}{4}}.\]

