By the Law of Cosines on triangle $ABC,$
\[BC = \sqrt{AB^2 + AC^2 - 2AB \cdot AC \cos A} = 2 \sqrt{5 - 3 \cos A}.\]Also, $OD = \frac{BC}{2} = \sqrt{5 - 3 \cos A}.$  Hence,
\begin{align*}
\overrightarrow{OA} \cdot \overrightarrow{BC} &= (\overrightarrow{OD} + \overrightarrow{DA}) \cdot \overrightarrow{BC} \\
&= \overrightarrow{OD} \cdot \overrightarrow{BC} + \overrightarrow{DA} \cdot \overrightarrow{BC} \\
&= \overrightarrow{OD} \cdot \overrightarrow{BC} + \overrightarrow{OA} \cdot \overrightarrow{AC} \\
&= \overrightarrow{OD} \cdot \overrightarrow{BC} + OA \cdot AC \cos A \\
&= \overrightarrow{OD} \cdot \overrightarrow{BC} + \sqrt{R^2 - OD^2} \cdot 5 \cdot \frac{AB}{2R} \\
&= \overrightarrow{OD} \cdot \overrightarrow{BC} + \frac{15}{2} \sqrt{1 - \frac{\overrightarrow{OD} \cdot \overrightarrow{OD}}{(2R)^2}}.
\end{align*}[asy]
unitsize (3 cm);

