By the Extended Law of Sines,
\[R = \frac{BC}{2 \sin A} = 2 \sqrt{\frac{5 - 3 \cos A}{2 - 2 \cos A}}.\]Then
\[\frac{1}{4} BC^2 = 5 - 3 \cos A,\]so
\[\cos A = \frac{3}{4} - \frac{1}{4} \cdot \frac{BC^2}{5}.\]Then
\[R^2 - OD^2 = 4 \left(5 - 3 \cos A\right) - \left(5 - 3 \cos A\right) = 12 \left(5 - \frac{1}{4} BC^2\right),\]so
\[\frac{\sqrt{R^2 - OD^2}}{2R} = \sqrt{\frac{5}{3} - \frac{1}{12} BC^2}.\]Therefore,
\[\overrightarrow{OA} \cdot \overrightarrow{BC} = \overrightarrow{OD} \cdot \overrightarrow{BC} + \frac{15}{2} \sqrt{\frac{5}{3} - \frac{1}{12} BC^2} = \overrightarrow{OD} \cdot \overrightarrow{BC} + \frac{15}{2} \sqrt{10 - \frac{3}{4} BC^2}.\]Then $\overrightarrow{OD} \cdot \overrightarrow{BC} = |OD| \cdot |BC| \cos 90^\circ = 0,$ so
\[\overrightarrow{OA} \cdot \overrightarrow{BC} = \frac{15}{2} \sqrt{10 - \frac{3}{4} BC^2} = \frac{15 \sqrt{80 - 3 BC^2}}{4} = \boxed{\frac{45 \sqrt{46}}{8}}.\]

