gpt-4:
We start by noting that \[\frac{\sin x \tan y}{\cos x + \sin x \sin y} = \frac{\sin x \sin y}{\cos x \cos y + \sin x \cos y} = \frac{\sin x \sin y}{\cos (90^\circ -(x+y))}.\]Now, setting $x=n^\circ$ and $y=(45-n)^\circ,$ where $1^\circ\le x,y,$ we cover each $n$ exactly once, and
\begin{align*}
\frac{\sum_{n=1}^{44}\cos(n^\circ)}{\sum_{n=1}^{44}\sin(n^\circ)} &=\frac{\sum_{n=1}^{44}\frac{\sin(45^\circ-n^\circ)}{\tan(n^\circ)} }
{\sum_{n=1}^{44}\frac{\cos(45^\circ-n^\circ)}{\cos(n^\circ)} }\\ &:=\frac{A}{B}
\end{align*}In the sum $A$ we substitute $2^\circ,$ $3^\circ,$ $\dots,44^\circ$ for $n$ and let the new sum be $A^\prime;$ similarly we allow $n$ to range over the same values and let the new sum be $\frac{B^\prime}{B}.$ Thus we in fact need only consider\begin{align*}
A&=\frac{\sin44^\circ}{\tan1^\circ}-A^\prime\\
&=\frac{\cos45^\circ\sin44^\circ+(\sin45^\circ-\cos45^\circ)\cos44^\circ}{\sin45^\circ\cos44^\circ+\cos45^\circ\sin44^\circ}\\ &=\frac{\cos45^\circ\sin44^\circ+\sin45^\circ\cos44^\circ-\cos44^\circ-\sin44^\circ}
{\sin45^\circ\cos44^\circ+\cos45^\circ\sin44^\circ-\cos44^\circ}.
\end{align*}Using the sum-to-product identities, the numerator factors to $(\sin45^\circ-\cos45^\circ)(\cos44^\circ+\sin44^\circ)$ and the denominator to $(\sin45^\circ+\cos45^\circ)(\cos44^\circ+\sin44^\circ-\sum_{k=0}^3\sin((44+45k)^\circ))$ (by the tangent addition formula.) The desired sum is hence $\boxed{-2}$.

