When the ball hits the ground, its height is 0. So we set $y$ to 0 and solve for $t$:

\begin{align*}
0 &= -16t^2 + 26t + 105\\
\Rightarrow\qquad 16t^2 - 26t - 105 &= 0
\end{align*}

We can simplify this by dividing everything by 2:

\begin{align*}
8t^2 - 13t - \frac{105}{2} &= 0\\
\Rightarrow\qquad 16t^2 - 26t - 105 &= 0 \qquad\qquad\text{(multiplying by 2)}
\end{align*}

Now we can use the quadratic formula:

\begin{align*}
t &= \frac{-(-26) \pm \sqrt{(-26)^2 - 4(16)(-105)}}{2(16)}\\
&= \frac{26 \pm \sqrt{26^2 + 16\cdot 105}}{32}\\
&\approx \boxed{3.1}\quad\text{or}\quad \boxed{-1.7}
\end{align*}

The negative value of $t$ doesn't make sense in this context (it would mean that the ball was already on the ground when it was tossed), so we discard it. The ball will hit the ground after approximately $\boxed{3.1}$ seconds.

