Let $A$ be the area of the floor in square feet and $C$ be the cost to carpet that floor in dollars. We have the proportion $A:kC$, where $k$ is a constant of proportionality.

From the first statement in the problem, we know that $14\cdot 5=70$ square feet of carpet costs $\$105$, so we can set up the equation $\frac{70}{k}=105$ to find $k$:

\begin{align*}
\frac{70}{k}&=105 \\
70&=105k \\
k&=\frac{70}{105}=\frac{2}{3}
\end{align*}

Therefore, we have $A:kC \implies A:\frac{2}{3}C$.

To find the cost $C$ of carpeting a $16\times 13$ square foot floor, we plug in the area $A=16\cdot 13=208$:

\begin{align*}
A:\frac{2}{3}C &= 208:\frac{2}{3}C \\
\frac{2}{3}C &=\frac{208}{1} \\
C &= \boxed{312}
\end{align*}

Therefore, it will cost $\$312$ to carpet a $16\times 13$ square foot floor.

solution:
Let $C$ be the cost of carpeting a floor and $A$ be the area.  By the definition of a direct proportion, we know that $C=kA$, where $k$ is a constant.  Substituting $105$ for $C$ and $14\times 5=70$ for $A$, we can find that $k=3/2$.  Then, the cost to carpet a floor that is $16\times13$ square feet will be: \begin{align*}
C&=kA\\
&=(3/2)(16\times13)\\
&=\boxed{312 \text{ dollars}}.
\end{align*}

