At 4:20 a.m., the minute hand is on the 4 and the hour hand is halfway between the 4 and 5. We can imagine the clock face divided into 12 equal parts (for the hours) and each hour divided into 5 equal parts (for the minutes). The minute hand is 20/60 = 1/3 of the way from the 4 to the 5, while the hour hand is 4.5/12 = 3/8 of the way from the 4 to the 5.

Let $x$ be the acute angle between the hands, in degrees, so $0\le x<180$. Since the minute hand is 1/3 of the way from the 4 to the 5, it has covered $\frac{1}{3}\cdot 360^\circ = 120^\circ$ around the clock face. Similarly, since the hour hand is 3/8 of the way from the 4 to the 5, it has covered $\frac{3}{8}\cdot 360^\circ = 135^\circ$ around the clock face.

[asy]
