draw(circle((0,0),1));
draw((0,0)--(0.8,0));
draw((0,0)--dir(120));
fill((0,0)--0.8*dir(120)--0.85*dir(120)--0.85*dir(120+120/8)--dir(120+120/8)--(0,0)--cycle,gray(0.7));
label("$x$",0.3*dir(20));
[/asy]

Since the hour hand moves at 1/12 the rate of the minute hand, the minute hand ``gains'' $(1/3-1/12)360^\circ = 30^\circ$ on the hour hand each hour. Therefore, at 4:20 a.m., the minute hand is $30^\circ$ ahead of where it would have been at 4:00 a.m., while the hour hand is $20\cdot 0.5^\circ = 10^\circ$ past the 4. Together, the hands form an angle of $120^\circ - 135^\circ + 10^\circ = \boxed{5^\circ}$.

