Taking $ABC$ to be the base of pyramid $ABCH$, the height is $HD$.  Therefore, the volume of pyramid $ABCH$ is $$\frac{[ABC](HD)}{3}.$$We are given that this volume equals 20, so we have \[{[ABC]\cdot HD}=60.\]The volume of prism $ABCDEFGH$ is the product of area of $ABCD$ and the height of the prism, which equals $HD$.   The area of $ABC$ is half the area of rectangle $ABCD$, so we have  \begin{align*}
\text{Volume of }ABCDEFGH &= ([ABCD])(HD) \\
&= 2([ABC])(HD) \\
&= \boxed{120}.\end{align*}

Remember that $\frac{1}{3} = 0.\overline{3}.$ We can multiply both the numerator and denominator by $10$ to help simplify the fraction: \begin{align*}
\frac{0.\overline{3}}{0.8\overline{3}} \cdot \frac{10}{10} &= \frac{0.\overline{3}\cdot 10}{0.8\overline{3} \cdot 10} =\frac{3.\overline{3}}{8.\overline{3}} \\
&=\dfrac{3+\frac{1}{3}}{8+\frac{1}{3}} =\dfrac{\frac{10}{3}}{\frac{25}{3}} \\
&=\frac{\cancelto{2}{10}}{\cancel{3}} \cdot \frac{\cancel{3}}{\cancelto{5}{25}\hspace{3mm}} =\boxed{\frac{2}{5}}.
\end{align*}

